import Card from './Card';



function Cards(props) {
   const { characters } = props;
   return ( 
      <div>
         {
            characters.map(({name, species, gender, image}) => { // destructuring
               return <Card
               name={name}
               species={species}
               gender={gender}
               image={image}
               onClose={() => window.alert('Emulamos que se cierra la card')}
               />
            })
         }
      </div>
   )
}

export default Cards;
